■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">刃先が磨耗しても常にエッジが残っている為、再鍛造しなくても高い破砕力が維持できます。また、オフセット砥石を付けたディスクグラインダーで2～3分研磨すると新品同様に甦ります。エッジ断面がプラス(十字)形状で破砕物への食いつき・食い込みが良く、従来品に比べ仕事量が約1.4倍(メーカー比)で作業効率が良く仕事が楽です。エッジの長さが10センチで従来品の約3.5倍ありますので長時間使用できます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">18φ×450mm</font><br><font color="#333333" size="-1">個装サイズ：48×2.8×2.8cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：758g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">特殊合金工具鋼</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">適合機種/ボッシュ:GSH5CE/N・GBH5DCE、ヒルティ:TE704・TE75、日立:H41MA・DH40MA、マキタ:HM1100C・HR4000C、リョービ:ED400など</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
