<br>●シムプレート等の薄い物でも確実に掴める「ギア歯」を搭載しています。
<br>●通常のラジオペンチと比較し軽い力で細い線を切断可能です。
<br>●グリップ断面がT型になっており、軽量かつグリップのねじれを防止します。
<br>●フィールドメンテナンスの必須ツールです。
<br>●狭く奥まった所のネジでも外せるラジオペンチタイプです。
